Pro tip: If your couple has a bunch of detail goodies to document, split them up into groupings so you’re not so overwhelmed with trying to fit it all into one image. 

@ckbrooks123 and @rachelwillisevents both had a vision that these details would have “stand alone” moments and not come off looking crowded. I may be biased, but I’d like to think we knocked it out of the park on these 😉

Special shout out to @jamieparkphoto for the help on the invite & table card photos! Couldn’t have done it without a wonderful team and amazing people!

Originally constructed in 1929, the United States Post Office and Courthouse is one of the most significant architectural buildings in the state of Texas and is a registered historic national landmark.  400 North Ervay is one of the most iconic event spaces in Texas!

